import React from 'react'
import './MealsList.css'
import MealItem from '../UI/MealItem/MealItem.js'

export default function MealsList(props) {


  const mealItems = props.mealsData.map(item => <MealItem
                                                        id={item.id}
                                                        title={item.title}
                                                        desc={item.desc}
                                                        price={item.price}
                                                        img={item.img}
                                                        addSum={()=>{props.addSum}}
                                                        subSum={props.subSum}/>)


  return (

    <div className='meals' >
      {mealItems}

    </div>
  )
}
